<style>
    @keyframes stroke-animation {
        0% {
            stroke-dasharray: 0, 1000;
            stroke: #00ff00;
        }

        50% {
            stroke-dasharray: 1000, 0;
            stroke: #ff0000;
        }

        100% {
            stroke-dasharray: 0, 1000;
            stroke: #0000ff;
        }
    }

    #icon1 path,
    #icon2 path,
    #icon3 path,
    #icon4 path,
    #icon5 path {
        /* if you using infinity then our use in loding otherwise this is logo */
        animation: stroke-animation 5s ease;
        stroke-width: 6;
        fill: none;
    }



    #icon1 path,
    #icon2 path,
    #icon3 path,
    #icon4 path,
    #icon5 path {
        stroke: black;
    }


    #icon2,
    #icon3,
    #icon4,
    #icon5 {
        stroke: blue;
    }
</style>
